DROP VIEW IF EXISTS Salesperson_SubscriberView;
GO
CREATE VIEW Salesperson_SubscriberView AS
SELECT 
		CONCAT(n.FirstName, ' ', n.LastName) AS 'Full Name', 
		CONCAT(a.StreetNo, ' ', a.StreetName, ' Street') AS 'Address',
		CONCAT(a.City, ' ', a.Suburb) AS 'City'
	FROM 
		Subscriber su
	JOIN
		Person pe
	ON
		su.PersonID = pe.PersonID
	JOIN 
		"Name" n
	ON
		n.NameID = pe.NameID
	JOIN
		"Address" a
	ON
		a.AddressID = pe.AddressID;

GO
DROP VIEW IF EXISTS Salesperson_DataContractView;
GO
CREATE VIEW Salesperson_DataContractView AS
SELECT 
    dc.DataContractID,
	dc.ZoneID,
	ss.SubscriberID
FROM 
    DataContract dc
JOIN
	Platinum_Subscription ps
ON 
	dc.DataContractID = ps.DataContractID
JOIN
	Standard_Subscription ss
ON
	ss.SubscriptionID = ps.SubscriptionID;

GO
DROP VIEW IF EXISTS Salesperson_DataScoopContractView;
GO
CREATE VIEW Salesperson_DataScoopContractView AS
SELECT 
    ds.DataScoopContractID,
	ds.ZoneID,
	ss.SubscriberID
FROM 
    DataScoopContract ds
JOIN
	Super_Platinum_Subscription sp
ON 
	ds.DataScoopContractID = sp.DataScoopContractID
JOIN
	Standard_Subscription ss
ON
	ss.SubscriptionID = sp.SubscriptionID;

