-- QUERIES --

-- Transaction A --
/* A salesperson subscribes to a new standard subscription to a DataScoop. The
transaction receives the salesperson Id, a discount %, all subscriber details,
and a DataScoop ID. */

DROP PROCEDURE IF EXISTS NewSubscription;
GO
CREATE PROCEDURE NewSubscription 
	@DataScoopId INT,
	@Email VARCHAR(80), 
	@StreetName VARCHAR(80), 
	@StreetNo INT, 
	@City VARCHAR(80), 
	@Suburb VARCHAR(80), 
	@FirstName VARCHAR(80),
	@LastName VARCHAR(80),
	@Discount DECIMAL,
	@SalespersonID INT
AS
BEGIN
	

	SELECT 
		@DataScoopId AS 'DataScoopID',
		CONCAT(@FirstName, ' ', @LastName) AS 'Full Name',
		CONCAT(@StreetNo, ' ', @StreetName, ' Street') AS 'Address',
		CONCAT(@City, ' ', @Suburb) AS 'City',
		CONCAT(@Discount, '%') AS 'Discount',
		@Email AS 'Email', 
		@SalespersonID AS 'SalespersonID';
END;
GO

EXEC NewSubscription @DataScoopId = 1, @Email = 'olliemoss321@gmail.com', @StreetName = 'Scotia', @StreetNo = 81, @City = 'Nelson', @Suburb = 'Whakatu', @FirstName = 'Ollie', @LastName = 'Moss', @Discount = 50, @SalespersonID = 10;


GO

-- Transaction B --
/* For each salesperson list the subscribers they have sold a subscription to. The
transaction receives the salesperson's name as input, and presents each
subscriber's name, address, and the % they were discounted. */

DROP PROCEDURE IF EXISTS SalespersonSubscribers;
GO
CREATE PROCEDURE SalespersonSubscribers
	@SalespersonFirstName VARCHAR(80),
	@SalespersonLastName VARCHAR(80)
AS
BEGIN
	SELECT 
		CONCAT(n.FirstName, ' ', n.LastName) AS 'Full Name', 
		CONCAT(a.StreetNo, ' ', a.StreetName, ' Street') AS 'Address',
		CONCAT(a.City, ' ', a.Suburb) AS 'City',
		CONCAT(sa.Discount, '%') AS 'Discount'
	FROM 
		Sale sa
	JOIN
		(SELECT 
			sp.StaffID AS 'StaffID'
		FROM
			Salesperson sp
		JOIN 
			Staff s
		ON 
			s.StaffID = sp.StaffID
		JOIN
			Person pe
		ON
			pe.PersonID = s.PersonID
		JOIN
			Name n
		ON
			n.NameID = pe.NameID
		WHERE 
			n.FirstName = @SalespersonFirstName AND
			n.LastName = @SalespersonLastName) si
	ON
		sa.SalespersonID = si.StaffID
	JOIN
		Standard_Subscription st
	ON
		st.SubscriptionID = sa.SubscriptionID
	JOIN
		Subscriber su
	ON 
		st.SubscriberID = su.SubscriberID
	JOIN
		Person pe
	ON
		su.PersonID = pe.PersonID
	JOIN 
		"Name" n
	ON
		n.NameID = pe.NameID
	JOIN
		"Address" a
	ON
		a.AddressID = pe.AddressID;
END;
GO
EXEC SalespersonSubscribers @SalespersonFirstName = 'Jesse', @SalespersonLastName = 'Braunfeld';

-- Transaction C --
/* Write a query to be used to insert data from a DataScoop to its stored data
on the FlightStream database. The transaction receives the DataScoop ID and
all the data from a data stream. That is made up of one or more records of
Temperature, Humidity, Ambient light strength, and organic spectral data,
time, longitude, latitude, and altitude. */

DROP PROCEDURE IF EXISTS InsertDataScoopData;
GO
CREATE PROCEDURE InsertDataScoopData
	@DataScoopId INT,
	@TimeRecorded DATETIME,
	@Temperature DECIMAL,
	@Humidity DECIMAL,
	@AmbientLightStrength DECIMAL,
	@OrganicSpectralData INT,
	@Longitude DECIMAL,
	@Latitude DECIMAL,
	@Altitude DECIMAL
AS
BEGIN
	SELECT 
		@DataScoopId AS 'DataScoopID',
		@TimeRecorded AS 'TimeRecorded',
		@Temperature AS 'Temperature',
		@Humidity AS 'Humidity',
		@AmbientLightStrength AS 'AmbientLightStrength',
		@OrganicSpectralData AS 'Organic Spectral Data',
		@Longitude AS 'Longitude',
		@Latitude AS 'Latitude',
		@Altitude AS 'Altitude';
END;
GO

