-- Transaction D --
/* List the location in latitude, longitude coordinates, of each DataScoop that is
currently in a contract. The transaction presents the DataContracting
organisation's name, a DataScoop ID, a Latitude, and a Longitude. */

DROP PROCEDURE IF EXISTS DataScoopLocations;
GO
CREATE PROCEDURE DataScoopLocations
AS
BEGIN
SELECT
	d.DataScoopID,
	l.Latitude,
	l.Longitude,
	n.FirstName AS "Name"
FROM 
	DataContract c
JOIN
	Zone z
ON
	z.ZoneID = c.ZoneID
JOIN
	DataScoop d
ON
	d.ZoneID = z.ZoneID
JOIN
	Location l
ON 
	l.LocationID = d.LocationID
JOIN
	Platinum_Subscription ps
ON
	ps.DataContractID = c.DataContractID
JOIN
	Standard_Subscription ss
ON
	ss.SubscriptionID = ps.SubscriptionID
JOIN
	Subscriber su
ON
	su.SubscriberID = ss.SubscriberID
JOIN
	Person pe
ON
	su.PersonID = pe.PersonID
JOIN 
	"Name" n
ON
	n.NameID = pe.NameID;
END;
GO
EXEC DataScoopLocations;

-- Transaction E --
/* For a contract list all the data collected. The transaction receives the
contracting organisation's name and presents for each collected data record,
the contracting organisation's name, a DataScoop ID, Temperature, Humidity ,
Ambient light strength, and organic spectral data. */

DROP PROCEDURE IF EXISTS DataContractData;
GO
CREATE PROCEDURE DataContractData
	@OrgName VARCHAR(80)
AS
BEGIN
	SELECT
	da.DataScoopID,
	n.FirstName AS "Name",
	da.Temperature,
	da.Humidity,
	da.AmbientLightStrength,
	da.OrganicSpectralData
	
FROM 
	DataContract c
JOIN
	Data da
ON 
	da.ContractID = c.DataContractID
JOIN
	Platinum_Subscription ps
ON
	ps.DataContractID = c.DataContractID
JOIN
	Standard_Subscription ss
ON
	ss.SubscriptionID = ps.SubscriptionID
JOIN
	Subscriber su
ON
	su.SubscriberID = ss.SubscriberID
JOIN
	Person pe
ON
	su.PersonID = pe.PersonID
JOIN 
	"Name" n
ON
	n.NameID = pe.NameID
WHERE
	n.FirstName = @OrgName;
END;
GO
EXEC DataContractData @OrgName = 'Betta';

-- Transaction F --
/* For each DataScoop present the list of subscribers who are viewing a live 3D
video stream. The transaction lists DataScoop ID, Subscriber Name, Stream ID. */

DROP PROCEDURE IF EXISTS SubscribersViewing;
GO
CREATE PROCEDURE SubscribersViewing
AS
BEGIN
SELECT 
	d.DataScoopID,
	CONCAT(n.FirstName, ' ', n.LastName) AS 'Full Name',
	v.VideoStreamID
FROM
	DataScoop d
JOIN
	VideoStream v
ON
	v.DataScoopID = d.DataScoopID
JOIN
	Standard_Subscription ss
ON
	ss.VideoStreamID = v.VideoStreamID
JOIN
	Subscriber su
ON
	su.SubscriberID = ss.SubscriberID
JOIN
	Person pe
ON
	su.PersonID = pe.PersonID
JOIN 
	"Name" n
ON
	n.NameID = pe.NameID
END;
GO
EXEC SubscribersViewing;

-- Transaction G --
/* For a given DataScoop list all the suppliers of parts. The transaction receives
the DataScoop ID, and presents the Supplier Name and, Part Name. */

DROP PROCEDURE IF EXISTS Suppliers;
GO
CREATE PROCEDURE Suppliers
	@DataScoopId INT
AS
BEGIN
	SELECT 
	pa."Name" AS 'Part Name',
	n.FirstName AS 'Supplier Name'
FROM 
	Part pa
INNER JOIN 
	Supplier s 
ON 
	pa.SupplierID = s.SupplierID AND
	pa.DatascoopID = @DataScoopId
INNER JOIN
	Person pe
ON
	pe.PersonID = s.PersonID
INNER JOIN
	"Name" n
ON
	n.NameID = pe.NameID;
	
END;
GO

EXEC Suppliers @DataScoopID = 1;

-- Transaction H --
/* Update the location and Zone of a DataScoop. The transaction receives the
DataScoop ID, a location and a Zone expressed as a list of coordinates in
latitude, longitude pairs. It updates the location of the DataScoop and its
corresponding Zone. (This transaction may require more than one update
query.) */

-- For the sake of simplicity location of a zone is expressed as one latitude longitude pair in a string e.g. '-23.7981763, -48.5962748'

DROP PROCEDURE IF EXISTS UpdateLocation;
GO
CREATE PROCEDURE UpdateLocation
	@DataScoopId INT,
	@Longitude DECIMAL,
	@Latitude DECIMAL,
	@Altitude DECIMAL,
	@Location VARCHAR(50)
AS
BEGIN
	UPDATE Location
	SET Longitude = @Longitude,
		Latitude = @Latitude,
		Altitude = @Altitude
	WHERE LocationID IN (
	SELECT l.LocationID FROM Location l
	JOIN DataScoop da
	ON da.LocationID = l.LocationID
	WHERE da.DataScoopID = @DataScoopId
	);

	UPDATE Zone
		SET Location = @Location
	WHERE
		ZoneID IN (SELECT ZoneID FROM DataScoop WHERE DataScoopID = @DataScoopID);
	
	SELECT * FROM Location WHERE LocationID IN (
	SELECT l.LocationID FROM Location l
	JOIN DataScoop da
	ON da.LocationID = l.LocationID
	WHERE da.DataScoopID = @DataScoopId
	);

	SELECT * FROM Zone WHERE ZoneID IN (SELECT ZoneID FROM DataScoop WHERE DataScoopID = @DataScoopID);
END;
GO

EXEC UpdateLocation @DataScoopId = '1', @Longitude = -48.2342318, @Latitude = 94.235153, @Altitude = 100.2345234, @Location = '-23.7981763, -48.5962748';

-- Transaction I --
/* Delete the data collected for a given DataContract. The transaction receives a
DataContract ID, the data collected for a DataContract is deleted. */

DROP PROCEDURE IF EXISTS DeleteData;
GO
CREATE PROCEDURE DeleteData
	@DataContractId INT
AS
BEGIN
	DELETE FROM Data
	WHERE ContractID = @DataContractId;
END;
GO
EXEC DeleteData @DataContractId = '1';

-- Transaction J --
/* Write a query that displays the total cost of all parts replaced in maintenance
of a DataScoop. The transaction displays the DataScoop ID, Total Cost of
replaced parts, for every DataScoop. */

-- NOTE: Total cost will be low because price column was quantity but quantity is kinda useless 
-- I forgot to add a price column
-- So I just changed quantity to price without updating data

DROP PROCEDURE IF EXISTS TotalCostOfMaintenance;
GO
CREATE PROCEDURE TotalCostOfMaintenance
AS
BEGIN
	SELECT d.DataScoopId, (SELECT SUM(p.Price) FROM Part p WHERE p.DataScoopID = d.DataScoopID) AS 'Total Cost' FROM DataScoop d;
END;

GO
EXEC TotalCostOfMaintenance;

